import React from 'react';
import { Box, Typography, Grid, makeStyles, Card } from '@material-ui/core';

const useStyles = makeStyles(theme => ({
    margin: { margin: "0 auto" }
}))

const ExtraHeaderSection = () => {
    const classes = useStyles();
    return (
        <>
            <section>
                <Box className="container-fluid my-3">
                    <Grid container>
                        <Grid item xl={10} md={11} xs={12} className={classes.margin}>
                            <Box style={{ border: "1px solid red" }}>
                                <Grid container>
                                    <Grid item xl={4} md={4} xs={12}></Grid>
                                    <Grid item xl={4} md={4} xs={12}></Grid>
                                    <Grid item xl={4} md={4} xs={12}></Grid>
                                </Grid>
                            </Box>
                        </Grid>
                    </Grid>
                </Box>
            </section>
        </>
    )
}

export default ExtraHeaderSection;
